Accounts_CustomFields_Description:
Duhet të jetë një JSON i vlefshëm ku çelësat janë emrat e fushës që përmbajnë një fjalor të cilësimeve të fushës. Shembull:<br/><code>{
"rol": {
"tipi": "zgjidhni",
"defaultValue": "student",
"opsionet": ["mësues", "student"],
"e nevojshme": e vërtetë,
"modifyRecordField": {
"array": e vërtetë,
"fushë": "role"
}
}
"Cicëroj": {
"tipi": "tekst",
"e nevojshme": e vërtetë,
"minLength": 2,
"maxLength": 10
}
}</code>

Custom_Translations_Description:
Duhet të jetë një JSON i vlefshëm ku çelësat janë gjuhë që përmbajnë një fjalor të çelësave dhe përkthimeve. Shembull:<br/><code>{
"en": {
"Kanalet": "Dhomat"
}
"pt": {
"Kanalet": "Salas"
}
}</code>
